            PareekRishi Kant PareekRishi Kant PareekRishi Kant PareekRishi Kant
            PareekRishi Kant PareekRishi Kant PareekRishi Kant PareekRishi Kant
            Pareek
          </Typography>
        </CardContent>
      </Box>
    </Card>
  );
}
